function updateTick() {
    var statusMessage = "Last linearization: ";

    this.indicator = !this.indicator;
    // it is important to nullify the last serialization,
    // otherwise it will be included in the forthcoming
    // serialization!
    this.lastSerialization = null;
    this.lastSerialization = this.diffTransfer.getCurrentWorldSerialization();

    debugger;
    var s = 0;
    var suffix = ["B", "KB", "MB", "GB"];
    var lastSize = this.lastSerialization.length;
    while(lastSize > 1024) {
        s++;
        lastSize = lastSize / 1024;
    }

    statusMessage += Math.floor(lastSize*10)/10 + suffix[s];
    this.updateStatus(statusMessage);
    $morph("Status3").setFill(this.indicator? Color.green : Color.rgb(16, 255, 16))
}

