function updateTickingScripts(bool) {
    var time = 5000; //ms.
    if(bool && this.checkPrerequisites())
        this.startStepping(time, 'updateTick')
    else
        this.stopStepping();
}

7AACCAF2-21DA-40A6-9573-4EA84302057D.source:
function checkPrerequisites() {
    var prerequisitesAvailable = true;
    try {
        this.diffTransfer = new DiffTransfer();
    } catch(e) {
        prerequisitesAvailable = false;
    }
    if(prerequisitesAvailable) {
        this.setAllIndicatorsTo(Color.rgb(64, 255, 64));
        return true;
    } else {
        this.setAllIndicatorsTo(Color.rgb(255, 64, 64));
        this.showHelp();
        return false;
    }
}

